import React, {useState, useEffect, useRef} from 'react';
import PageDefault from '../../components/pageDefault';
import AboutMe from '../aboutMe';
import Home from '../home';
import Parent from './styles';

function MainPage(){
    return(
        <Parent>
            <PageDefault>
                <Home/>
                <AboutMe/>                 
            </PageDefault>
        </Parent>
    );
}

export default MainPage;
